edicine and surgery.\u003c/p\u003e\\n    \u003c/div\u003e\\n    \u003cdiv\u003e\\n      \u003ch4\u003eUniversiti Putra Malaysia (UPM), Malaysia\u003c/h4\u003e\\n      \u003cp\u003eClinical training in small animal medicine and surgery.\u003c/p\u003e\\n    \u003c/div\u003e\\n    \u003cdiv\u003e\\n      \u003ch4\u003eMindray Animal Care, China\u003c/h4\u003e\\n      \u003cp\u003eClinical training in echocardiography for small animals.\u003c/p\u003e\\n    \u003c/div\u003e\\n    \u003cdiv\u003e\\n      \u003ch4\u003eTK-VETKIT, China\u003c/h4\u003e\\n      \u003cp\u003eClinical training in endoscopy for small animals.\u003c/p\u003e\\n    \u003c/div\u003e\\n  \u003c/section\u003e\\n\\n  \u003csection\u003e\\n    \u003ch3\u003eCurrent Position\u003c/h3\u003e\\n    \u003cp\u003e\u003cstrong\u003eAssociate Veterinary Officer\u003c/strong\u003e\u003cbr\u003e\\n      \u003ca href=\\\"https://maps.app.goo.gl/bSP9SnTMbWD6SnAS9\\\" target=\\\"_blank\\\"\u003eAnimed Care, Baridhara J Block, Dhaka, Bangladesh\u003c/a\u003e\\n    \u003c/p\u003e\\n  \u003c/section\u003e\\n\\n  \u003csection class=\\\"contact\\\"\u003e\\n    \u003ch3\u003eContact\u003c/h3\u003e\\n    \u003ca href=\\\"tel:+8801783180829\\\"\u003eCell: +8801783180829\u003c/a\u003e\\n    \u003ca href=\\\"mailto:debashish.vet@gmail.com\\\"\u003eE-mail: debashish.vet@gmail.com\u003c/a\u003e\\n    \u003cdiv class=\\\"qr\\\"\u003e\\n      \u003cp\u003eScan to chat on WhatsApp:\u003c/p\u003e\\n      \u003cimg src=\\\"https://api.qrserver.com/v1/create-qr-code/?size=150x150\u0026data=https://wa.me/8801783180829\\\" alt=\\\"WhatsApp QR Code\\\"\u003e\\n    \u003c/div\u003e\\n  \u003c/section\u003e\\n\u003c/body\u003e\\n\u003c/html\u003e\\n\",\"access\",\"public\",\"isModerationBlocked\",\"isAnonifyApiKeyDetected\",\"actionData\",\"errors\"]\n");</script><!--$--><script nonce="">window.__reactRouterContext.streamController.enqueue("P4198:[{\"_4217\":30,\"_4218\":30,\"_4219\":12},\"401278363\",\"753853109\",\"2173548801\"]\n");</
